import React, { useEffect, useState } from "react";

const ApiData = () => {
  const [apiData, setApiData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(
          "https://api.thingspeak.com/channels/2215615/feeds.json?api_key=3QR76I7LLTAEW53G&results=2"
        );
        const data = await response.json();
        setApiData(data);
      } catch (error) {
        console.error("Error fetching API data:", error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      {/* Display the API data */}
      {apiData && (
        <div>
          <h2>{apiData.channel.name}</h2>
          <p>Latitude: {apiData.channel.latitude}</p>
          <p>Longitude: {apiData.channel.longitude}</p>
          {/* Iterate over the feeds array */}
          {apiData.feeds.map((feed) => (
            <div key={feed.entry_id}>
              <p>Field 1: {feed.field1}</p>
              <p>Field 2: {feed.field2}</p>
              <p>Field 3: {feed.field3}</p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default ApiData;
